import React, { Suspense, lazy } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const Home = lazy(() => import('./App/Home/home'));
const Login = lazy(() => import('./App/Login/login'));
const Cliente = lazy(() => import('./App/Cliente/cliente'));
const ListarClientes = lazy(() => import('./App/Cliente/ListarClientes'));
const CadastroUsuario = lazy(() => import('./App/CadastroUsuario/CadastroUsuario'));


const App = () => (
  <Router>
    <Suspense fallback={<div>Carregando...</div>}>
      <Routes>
        <Route path='/' element={<Login />} />
        <Route path="/Home" element={<Home />} />
        <Route path="/Cliente" element={ <Cliente />} />
        <Route path='/ListarClientes' element={ <ListarClientes />} />
        <Route path='/CadastroUsuario' element={ <CadastroUsuario />} />
      </Routes>
    </Suspense>
  </Router>
);

export default App;
